     function getChar(event) {

         return String.fromCharCode(event.which)   // the rest
       } else {
         return null // special key
       }

function shuffleFull(){
  $("div#displayBoard").text("")
    totalLength = showArray.length + 1;
    pointer = Math.floor(Math.random() * totalLength)
    topicSelected = showArray[pointer];
  for(var i=0; i<126; i++){
      theImg = "<img src=\"" + urlHeader + topicSelected +formatNum(i,3) + imgTail + "\"><br>"

    $("div#displayBoard").append(theImg)
    }
    showArray.splice(pointer,1)
    if(showArray.length == 0){showArray = listArray;}
}

function formatNum(num, size) {
    var stkcode = "000000000" + num;
    return stkcode.substr(stkcode.length-size);
}
